import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Message from '../Composants/Message'


export default class TypeChambre extends Component {
     
    render() {
        let messages=[
            {id:1 ,auteur:"wadi", msg:"bonjour comment cv"},
            {id:2 ,auteur:"Koko", msg:"salut wadi cv et toi"},
            {id:3 ,auteur:"bobo", msg:"ey wesh ma geule"}

        ]

        messages = messages.map(message=>{
          return <Message key={message.id} message={message} />
        })
        return (
<>
<script src="FonctionSpeech.js"></script>
            <section>
                <button class="btn-start">start</button>
                <button class="btn-end">end</button>
                <textarea class="output"></textarea>
                
            </section>
            <section>
             <div>
                  {messages}  
             </div>
             
            </section>

           
            

</>

        )
    }
}
